import React from "react";

import { useNavigate } from "react-router-dom";

const HomeButton = () => {

  let navigate = useNavigate();

  return (
    <div>
      <button onClick={() => {navigate("/")}}>Home</button>
    </div>
  );
}

export default HomeButton;
